// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.4.21 <0.9.0;

contract Election {

    struct Voter {
        uint voterAddr;
        bool isVoted;
    }

    struct Candidate {
        uint id;
        string name;
        string division;
        string photoPath;
        uint voteCount;
    }

    mapping(address => bool) public voters;

    // mapping(uint => Voter) public voters;

    mapping(uint => Candidate) public candidates;

    uint public votersCount;
    uint public candidatesCount;

    event votedEvent (
        uint indexed _candidateId, address indexed _voterId
    );

    constructor() {
        addCandidate("PAP", "Yishun", "");
        addCandidate("SDP", "Yishun", "");
        addCandidate("SGP", "Yishun", "");
    }

    function addCandidate(string memory name, string memory division, string memory photoPath) private {
        candidatesCount++;
        candidates[candidatesCount] = Candidate(candidatesCount, name, division,photoPath, 0);
    }

    // function addCandidates(string[] memory name, string memory division) private {
    //     candidatesCount++;
    //     candidates[candidatesCount] = Candidate(candidatesCount, name, division, 0);
    // }

    function vote(uint _candidateId) public {
        require(!voters[msg.sender]);
        require(_candidateId > 0 && _candidateId <= candidatesCount);

        voters[msg.sender] = true;

        emit votedEvent(_candidateId, msg.sender);
    }

    function getCandidates(string memory division) external view returns (string[] memory, uint[] memory) {
        string[] memory names = new string[](candidatesCount);
        uint[] memory voteCounts = new uint[](candidatesCount);
        for (uint i = 0; i < candidatesCount; i++) {
            if (keccak256(abi.encodePacked(candidates[i].division)) == keccak256(abi.encodePacked(division))) {
                names[i] = candidates[i].name;
                voteCounts[i] = candidates[i].voteCount;
            }
            
        }
        return (names, voteCounts);
    }
}
